  {
      font-family: Montserrat,sans-serif;
      font-size: 2rem;
      font-weight: 800;
      color: white;
      position: absolute;
      width: calc(100% - 3rem);
      bottom: 100%;
      margin-bottom: .625rem;
  }
  .nouv_classicPopin h3
  {
      font-size:1.375rem;
  }
  .nouv_classicPopin .nouv_conteneurtexte
  {
      height:7.875rem;
      margin-bottom:1.5rem;
      color:#4a4a4a;
  }
  .nouv_classicPopin .swiper-container, .cover
  {
      height:22.375rem;
  }
  @media (max-width: 767px)
  {
      .nouv_classicPopin
      {
          width:18rem;
          height:auto;
          padding:1rem;
      }
      .nouv_classicPopin .nouv_conteneurtexte
      {
          height:8.6rem;
          margin-bottom:1rem;
          color:#4a4a4a;
      }
      .nouv_classicPopin h2
      {
          width: calc(100% - 2rem);
      }
      .nouv_classicPopin img
      {
          height:8.6875rem;
          width:16rem;
      }
      .nouv_classicPopin h3
      {
          font-size:1rem;
      }
      .nouv_classicPopin .swiper-container
      {
          height:19.3rem;
      }
  }

  .nouv_classicPopin.reduite
