  }
  .nouv_classicPopin.etendue
  {
      cursor: default;
  }
  .nouv_classicPopin svg
  {
      width:1.5rem;
      height:1.5rem;
      margin:1rem;
      vertical-align: top;
  }
  .nouv_classicPopin .nouv_content
  {
      display:inline-block;
      width:15rem;
  }
  .nouv_classicPopin .nouv_buttons
  {
      height:0;
      overflow:hidden;
      transition: height .5s ease-out;
  }
  .nouv_classicPopin.reduite .nouv_buttons
  {
      height:0;
  }
  .nouv_classicPopin .nouv_buttons
  {
      height:11rem;
  }
  .nouv_classicPopin .nouv_second
  {
      margin-top:1rem;
      font-size:.875rem;
  }
  .nouv_carousel .nouv_belowPopin, .nouv_classicPopin .nouv_belowPopin
