    color: inherit;
    cursor: pointer;
    -webkit-transition: all 0.3s ease;
    -moz-transition: all 0.3s ease;
    transition: all 0.3s ease; }
    .cob_link a,
    .cob_link button {
      font-size: 0.875rem;
      color: #333;
      text-decoration: underline;
      cursor: pointer;
      -webkit-transition: all 0.3s ease;
      -moz-transition: all 0.3s ease;
      transition: all 0.3s ease;
      border: 0;
      background: none; }
      .cob_link a:hover, .cob_link a:focus,
