                        <h2 class="dcw_alert-message_title">Alerte à la fraude : soyez vigilant</h2>
                        <p class="dcw_alert-message_desc">Une nouvelle tentative d’escroquerie se développe : les appels de personnes malveillantes se faisant passer pour le service fraude Société Générale. Dans le cas d’un appel, restez vigilant et ne transmettez pas le code reçu ou encore ne tapez pas votre code sécurité à la demande de votre interlocuteur. En tant qu’établissement bancaire, <strong>Société Générale ne vous demandera jamais, par SMS, email ou téléphone : votre numéro ou code de carte bancaire, le cryptogramme et la date de validité de votre carte bancaire, un code reçu par sms ou votre mot de passe de banque à distance</strong>.<br>
<strong>BON À SAVOIR</strong> : Votre Pass Sécurité ou code reçu par SMS ne peuvent en aucun cas bloquer une transaction mais uniquement la valider.</p>
