                        <h2 class="dcw_alert-message_title">Faux appel téléphonique : restons vigilants !</h2>
                        <p class="dcw_alert-message_desc">Nous constatons une <b>recrudescence de faux appels téléphoniques se faisant passer pour le support technique de Société Générale</b>. Restez très prudent lors de la réception d’un appel téléphonique signalant une fraude ou un blocage sur vos comptes. Des personnes malveillantes usurpent le numéro de téléphone de votre banque pour vous mettre en confiance et vous demander des <ins>informations totalement confidentielles</ins>. <b>Société Générale ne vous appellera jamais pour vous demander votre code reçu par SMS, votre mot de passe, votre numéro de carte bancaire ou d’annuler une opération en utilisant votre Pass Sécurité.</b> Ne vous laissez pas impressionner par le caractère urgent et pressant de la demande des fraudeurs. Gardez votre sang-froid, raccrochez et appelez votre Conseiller Société Générale immédiatement.</p>
                </div>
